import React from 'react'
import CloseIcon from '@mui/icons-material/Close';
import CreateIcon from '@mui/icons-material/Create';
import "./todo.css"
function Todo({text}) {
  return (
    <div className='todo'>
        <p>{text}</p>
        <div className='menu'>
            <CloseIcon />
            <CreateIcon/>
        </div>
    </div>
  )
}

export default Todo
